const EMPTY_PROCESS = {
    processName: '',
    processSubject: '',
    processDescription: '',
    processConcernment: [],
}

const INITIAL_STATE = {
    process: EMPTY_PROCESS,
    processList: []
}

export function processReducer(state = INITIAL_STATE, action) {
    console.log('processReducer', state, action);
    return state;
}
